import React from 'react';
import { createIconSet } from 'react-native-vector-icons';
const glyphMap = require(`../../assets/fonts/remixicon.glyphmap`);
const Icon = createIconSet(glyphMap, 'remixicon', 'remixicon.ttf');

export default Icon;
